from collections import defaultdict

def construct_array_from_constraints(N, B):
    count = defaultdict(int)
    minim = +1
    for i in range(N):
        if B[i] != -1:
            if B[i] > i + 1 or B[i] < minim:
                return -1
            else:
                minim = B[i]
                count[B[i]] += 1
    smallest = 0
    ans = [None] * N
    i = 0
    next = -1
    while i < N:
        if next != -1:
            if next == smallest:
                smallest += 1
            ans[i] = next
            next = -1
            if B[i] != -1:
                count[B[i]] -= 1
                if count[B[i]] == 0:
                    next = B[i]
            i += 1
        elif count[smallest] == 0:
            ans[i] = smallest
            if B[i] != -1:
                count[B[i]] -= 1
                if count[B[i]] == 0:
                    next = B[i]
            i += 1
            smallest += 1
        else:
            smallest += 1
    return ans

